How to query MongoDB array to see if it has multiple instances of same $elemMatch?<p>I have a collection where each document has an array (called <code>elements</code>) in it. Each element within this array represents an object with a <code>name</code> and <code>age</code> value. I have some documents where in the array, I will have duplicate objects, or at least objects with some similar values (i.e. the <code>name</code> is the same).</p>
<p>My collection looks like this (notice how the 2nd document has 2 instances of <code>Bob</code>):</p>
<pre><code>[
  {
    &quot;_id&quot;: {
      &quot;$oid&quot;: &quot;6395471f80495752e7208c63&quot;
    },
    &quot;elements&quot;: [
      {
        &quot;name&quot;: &quot;Alice&quot;,
        &quot;age&quot;: 20
      },
      {
        &quot;name&quot;: &quot;Bob&quot;,
        &quot;age&quot;: 21
      },
      {
        &quot;name&quot;: &quot;Charlie&quot;,
        &quot;age&quot;: 23
      }
    ]
  },
  {
    &quot;_id&quot;: {
      &quot;$oid&quot;: &quot;6395486980495752e7208c67&quot;
    },
    &quot;elements&quot;: [
      {
        &quot;name&quot;: &quot;Alice&quot;,
        &quot;age&quot;: 20
      },
      {
        &quot;name&quot;: &quot;Bob&quot;,
        &quot;age&quot;: 21
      },
      {
        &quot;name&quot;: &quot;Bob&quot;,
        &quot;age&quot;: 24
      }
    ]
  }
]
</code></pre>
<p>I want to be able to build a query with <code>$elemMatch</code> so that if I want to, I can find a document which has multiple instances of the same <code>$elemMatch</code> element, i.e. I want to be able to find a document which has an <code>elements</code> array with 2 Bob's in it.</p>
<p>I have tried doing a query like the one below, but with no success.</p>
<pre><code>db.collection.find({
  $and: [
    {
      elements: {
        $elemMatch: {
          name: &quot;Bob&quot;
        }
      }
    },
    {
      elements: {
        $elemMatch: {
          name: &quot;Bob&quot;
        }
      }
    }
  ]
})
</code></pre>
<p>The intended result of this query would be as follows:</p>
<pre><code>[
  {
    &quot;_id&quot;: ObjectId(&quot;6395486980495752e7208c67&quot;),
    &quot;elements&quot;: [
      {
        &quot;age&quot;: 20,
        &quot;name&quot;: &quot;Alice&quot;
      },
      {
        &quot;age&quot;: 21,
        &quot;name&quot;: &quot;Bob&quot;
      },
      {
        &quot;age&quot;: 24,
        &quot;name&quot;: &quot;Bob&quot;
      }
    ]
  }
]
</code></pre>
<p>Here is a <a href="https://mongoplayground.net/p/XZH4jNj3G36" rel="nofollow noreferrer">MongoPlayground link</a> which may make the problem easier to view.</p>

